  try {
    const buffer = Buffer.from(svg);
    const png = await sharp(buffer)
      .resize(size, size)
      .png({ compressionLevel: 9 })
      .toBuffer();

    // This keeps everything inside the circle
    // fully opaque and makes the outside area transparent.
    const r = Math.floor(size / 2) - 1; // a 1px inset to avoid edge artifacts
    const maskSvg = `<?xml version="1.0" encoding="UTF-8"?>
<svg xmlns="http://www.w3.org/2000/svg" width="${size}" height="${size}" viewBox="0 0 ${size} ${size}">
  <rect width="100%" height="100%" fill="#000" fill-opacity="0"/>
  <circle cx="${size / 2}" cy="${size / 2}" r="${r}" fill="#fff"/>
</svg>`;

    const maskedPng = await sharp(png)
      .composite([{ input: Buffer.from(maskSvg), blend: 'dest-in' }])
      .png({ compressionLevel: 9 })
      .toBuffer();

    fs.writeFileSync(outputPath, maskedPng);
    console.log(`Icon generated: ${outputPath}`);

    // Create an additional monochrome (grayscale) version for webview usage
    const monoPng = await sharp(maskedPng)
      .grayscale()
      .png({ compressionLevel: 9 })
      .toBuffer();

    fs.writeFileSync(monoOutputPath, monoPng);
    console.log(`Monochrome icon generated: ${monoOutputPath}`);

    // Strict verification: ensure both icon files exist and are non-empty.
    const colorStat = fs.statSync(outputPath);
    const monoStat = fs.statSync(monoOutputPath);
    if (!colorStat.size || !monoStat.size) {
      throw new Error('Icon generation produced empty files');
    }
  } catch (err) {
    console.error('Failed to generate icon:', err);
    process.exit(1);
  }
